import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule } from '@angular/forms';

import { AppComponent } from './app.component';
import { ProductShowAllComponent } from './product-show-all/product-show-all.component';
import { AddProductComponent } from './add-product/add-product.component';
import { AppRoutingModule } from './app-routing.module'; // Import the routing module here

@NgModule({
  declarations: [AppComponent, ProductShowAllComponent, AddProductComponent],
  imports: [BrowserModule, HttpClientModule, FormsModule, AppRoutingModule], // Include the AppRoutingModule here
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
